import axios from "axios";
import React from "react";

import { useState, useEffect } from "react"
import { useParams } from "react-router-dom";

// const QUIZ_API_BASE_URL = "http://localhost:8080/api/quiz/{id}/question";

function App(){
  const {id} = useParams();
const QUIZ_API_BASE_URL = "http://localhost:8080/api/quiz/"+`${id}`+"/question";

  const [post, setPost] = React.useState(null);

  React.useEffect(() => {
    axios.get(QUIZ_API_BASE_URL).then((response) => {
      setPost(response.data);
    });
  }, []);

  if (!post) return null;

  return (
    <div>
      <h1>{post.text}</h1>

    </div>
  );
}

export default App
